-- ----------------------------
-- Table structure for CIFPAY_BANK
-- ----------------------------
DROP TABLE IF EXISTS `CIFPAY_BANK`;
CREATE TABLE `CIFPAY_BANK` (
  `BANK_CODE` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '银行代码',
  `BANK_NAME` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '银行名称',
  `SUPPORT_CIFPAY1X` char(1) COLLATE utf8_bin NOT NULL COMMENT '是否支持旧版银信证：Y是，N否',
  `SUPORT_CIFPAY` char(1) COLLATE utf8_bin NOT NULL COMMENT '是否支持新版银信证：Y是，N否',
  `SUPPORT_BANK_CORP_DIRECT` char(1) COLLATE utf8_bin NOT NULL COMMENT '是否支持银企直联：Y是，N否',
  `SUPPORT_QUICK_PAYMENT` char(1) COLLATE utf8_bin NOT NULL COMMENT '是否支持快捷支付：Y是，N否',
  `ENABLE_STATUS` char(1) COLLATE utf8_bin NOT NULL COMMENT '启用状态：0 待开通，1 正常，2 已关闭',
  PRIMARY KEY (`BANK_CODE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='银行定义表';

