-- ----------------------------
-- Table structure for CIFPAY_BUS_LOCK_CTRL
-- ----------------------------
DROP TABLE IF EXISTS `CIFPAY_BUS_LOCK_CTRL`;
CREATE TABLE `CIFPAY_BUS_LOCK_CTRL` (
  `BUSINESS_TYPE` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '业务类型：  UPDATE_LC 更新银信证，对应的业务编号是LC_ID； SEND_LC_NOTICE 发送银信证通知，对应的业务编号是NOTICE_ID； SEND_TRADE_CHN_MSG 往交易渠道发送报文，对应的业务编号是MSG_ID',
  `BUSINESS_NO` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '业务编号：例如银信证ID、银信证通知ID、交易渠道报文ID',
  `LOCKED_DT` datetime NOT NULL COMMENT '锁定时间',
  `LOCKED_BY` varchar(256) COLLATE utf8_bin NOT NULL COMMENT '锁持有者',
  PRIMARY KEY (`BUSINESS_TYPE`,`BUSINESS_NO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='业务锁控制表，通过业务类型+业务编号为界定一笔业务操作，从而用以控制分布式环境下的并发处理。应用层在进行业务操作前，先通';

