-- Records of CIFPAY_BUS_LOCK_CTRL
-- ----------------------------

-- ----------------------------
-- Table structure for CIFPAY_LC
-- ----------------------------
DROP TABLE IF EXISTS `CIFPAY_LC`;
CREATE TABLE `CIFPAY_LC` (
  `LC_ID` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '银信证ID',
  `MER_ID` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '商户ID',
  `TRADE_CHN_ID` varchar(15) COLLATE utf8_bin NOT NULL COMMENT '交易渠道ID',
  `LC_NO` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '银信证展示编号',
  `LC_TYPE` varchar(10) COLLATE utf8_bin NOT NULL COMMENT '银信证型号：例如CP300、CP500等',
  `LC_CCY` varchar(5) COLLATE utf8_bin NOT NULL COMMENT '银信证开证币别：例如RMB',
  `LC_AMT` decimal(19,2) NOT NULL COMMENT '银信证开证金额',
  `LC_FROZEN_AMT` decimal(19,2) NOT NULL DEFAULT '0.00' COMMENT '银信证冻结金额',
  `LC_BALANCE` decimal(19,2) NOT NULL COMMENT '银信证可用余额',
  `REF_REQ_OPEN_DT` datetime NOT NULL COMMENT '请求方的开证参考时间',
  `OPEN_METHOD` varchar(2) COLLATE utf8_bin NOT NULL COMMENT '开证方式：10个人网银开证，20企业网银开证，30非UI交互开证',
  `PAYER_TYPE` char(1) COLLATE utf8_bin NOT NULL COMMENT '付款方类型：1个人，2企业',
  `PAYER_ID` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '付款方ID：若付款方类型为“个人”，则付款方ID对应为个人的用户ID或手机号；若为付款方类型为“商户”，则对应为商户的ID',
  `PAYER_BANK_CODE` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '付款方银行代码',
  `PAYER_BANK_NAME` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '付款方银行名称，冗余字段',
  `PAYER_BANK_ACCT` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '付款方银行账号，选填',
  `PAY_BANK_TXN_NO` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '付款方银行交易流水号，开证完成后，银行或第三方交易渠道返回的交易流水号',
  `OPEN_RESULT_UI_CB_URL` varchar(512) COLLATE utf8_bin DEFAULT NULL COMMENT 'UI响应式开证回调URL，若为纯API后台开证，则该字段可选',
  `OPEN_RESULT_ASYNC_CB_URL` varchar(512) COLLATE utf8_bin NOT NULL COMMENT '开证结果异步回调URL，开证完成后，银信证平台系统固定会通过该URL将开证结果通知请求方系统',
  `LC_STATE_NOTIFY_URL` varchar(512) COLLATE utf8_bin DEFAULT NULL COMMENT '银信证状态变更通知URL',
  `LC_OPEN_FINISH_DT` datetime DEFAULT NULL COMMENT '开证完成时间：指银信证完成开证后的交易时间',
  `LC_STATE` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '银信证当前状态：10初始化，11开证交易过期已关闭，20已开证，30已收证，40已履约（已提示解付），50付款方已签收（收款方已申请解付），60失效已退回付款方，70已主动解付，71失效已解付',
  `CURR_STATE_VALID_DT` datetime DEFAULT NULL COMMENT '当前状态有效期',
  `LC_VALID_DT` datetime DEFAULT NULL COMMENT '银信证有效截止日期',
  `REF_ORDER_NO` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '参考订单号（交易订单号）',
  `REF_ORDER_SUMMARY` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '参考订单概要',
  `PAYEE_TYPE` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '收款方类型：1-商户，2-个人',
  `PAYEE_ID` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '收款方ID：若收款方类别为“商户”时，则“收款方ID”对应为收款商户的ID，若收款方类型为“个人”，则“收款方ID”对应为收款个人的用户ID或手机号',
  `PAYEE_BANK_CODE` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '收款方银行代码',
  `PAYEE_BANK_NAME` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '收款方银行名称，冗余字段',
  `PAYEE_BANK_ACCT` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '收款方银行账号',
  `PAYEE_BANK_TXN_NO` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '收款行交易流水号：交易资金成功划出后，收款行返回的交易流水号；（未来规划）如果该银信证支持是分多次划出，则该字段留空',
  `CLEAR_COMPLETED_FLAG` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '是否已清算：Y已完成清算，N尚未清算',
  `CLEAR_COMPLETED_DT` datetime DEFAULT NULL COMMENT '清算日期',
  `CREATED_DT` datetime NOT NULL COMMENT '创建时间',
  `UPDATED_DT` datetime DEFAULT NULL COMMENT '更新时间',
  `REC_VALIDATE_HASH` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '数据校验码',
  `CHECK_RESULT` varchar(8) COLLATE utf8_bin DEFAULT NULL COMMENT '对账结果',
  `CHECK_STATUS` int(1) DEFAULT '0' COMMENT '对账状态',
  `CHECK_TIME` datetime DEFAULT NULL COMMENT '对账时间',
  `BANK_FILE_DATE` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '对账文件日期',
  PRIMARY KEY (`LC_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='银信证表';

