DROP TABLE IF EXISTS `CIFPAY_LC_STATE_CTRL`;
CREATE TABLE `CIFPAY_LC_STATE_CTRL` (
  `LC_ID` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '银信证ID',
