-- ----------------------------
-- Table structure for CIFPAY_LC_TXN_JOURNAL
-- ----------------------------
DROP TABLE IF EXISTS `CIFPAY_LC_TXN_JOURNAL`;
CREATE TABLE `CIFPAY_LC_TXN_JOURNAL` (
  `TXN_JOURNAL_ID` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '交易流水ID：由银信证平台系统自身分配的交易流水',
  `LC_ID` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '银信证ID',
  `TRADE_CHN_ID` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '交易渠道ID',
  `TXN_TYPE` varchar(3) COLLATE utf8_bin NOT NULL COMMENT '交易类型：\r\n            100开证，200收证，300提示解付（履约），400申请解付（签收），500执行解付，601失效自动退回付款方，602失效自动解付，603手动失效退回付款方',
  `TXN_DT` datetime NOT NULL COMMENT '请求交易时间',
  `TRADE_TXN_DT` datetime DEFAULT NULL COMMENT '响应交易时间',
  `TRADE_TXN_NO` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '交易渠道流水号：调用对方渠道时，对方系统返回的交易参考号',
  `LC_STATE` varchar(2) COLLATE utf8_bin DEFAULT NULL COMMENT '银信证状态',
  `LC_BALANCE` decimal(19,2) DEFAULT NULL COMMENT '银信证可用余额',
  `CREATED_DT` datetime NOT NULL COMMENT '创建日期',
  PRIMARY KEY (`TXN_JOURNAL_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='银信证交易流水表';

