-- ----------------------------
-- Procedure structure for PRO_BANK_BDHAS_PAY
-- ----------------------------
DROP PROCEDURE IF EXISTS `PRO_BANK_BDHAS_PAY`;
DELIMITER ;;
CREATE DEFINER=`cifpay`@`%` PROCEDURE `PRO_BANK_BDHAS_PAY`(bankFileId INT, bankFileDate VARCHAR(10))
begin
	declare onlyBankHasNum INT(8) default 0; -- 支付平台无银行有笔数
	declare bdFileDetailId INT(16); -- 对账文件明细ID
	declare bdPayAmount decimal(18,2); -- 银行交易金额
	declare bdPayTime datetime; -- 银行交易时间
	declare payContractNo VARCHAR(32); -- 支付渠道协议号
	declare payChannelTradeNo VARCHAR(64); -- 支付渠道交易流水号
	declare orderId VARCHAR(64); -- 支付平台流水号
	declare done INT DEFAULT FALSE; -- 遍历数据结束标志
	declare only_bdhas_cursor cursor for select f.BANK_FILE_DETAIL_ID, f.PAY_CONTRACT_NO, f.PAY_CHANNEL_TRADE_NO, f.ORDER_ID, 
		f.PAY_AMOUNT, f.PAY_TIME from F_BANK_FILE_DETAIL f
    where f.BANK_FILE_ID=bankFileId and f.PAY_STATUS='202' and f.ORDER_ID not in(
      select l.LC_ID from CIFPAY_LC l 
       where (DATE_FORMAT(l.UPDATED_DT,'%Y-%m-%d')=bankFileDate and l.LC_STATE=70 and l.CHECK_RESULT is null)
       or (l.CHECK_RESULT=402 and datediff(bankFileDate, l.UPDATED_DT)<=2)
    );
	declare CONTINUE HANDLER FOR NOT FOUND SET done = TRUE; -- 将结束标志绑定到游标

	-- 打开游标
  OPEN only_bdhas_cursor;
  -- 遍历游标
	read_loop: LOOP
  fetch only_bdhas_cursor into bdFileDetailId, payContractNo, payChannelTradeNo, orderId, bdPayAmount, bdPayTime;
		-- 声明结束的时候
		IF done THEN
			LEAVE read_loop;
		END IF;
	
    -- 更新文件明细
    update F_BANK_FILE_DETAIL d set d.CHECK_RESULT=403 where d.BANK_FILE_DETAIL_ID=bdFileDetailId;
    -- 保存差异结果到差异表
      BD_TRADE_NO, BD_BANK_AMOUNT, BD_PAY_TIME, BD_BANK_FILE_DATE,
      DIFFERENCE_AMOUNT, DIFFERENCE_TIME, DIFFERENCE_TYPE, CHECK_MISTAKE_NO, DEAL_STATUS) 
		  values(bdFileDetailId, bankFileId, orderId, payContractNo, 
      payChannelTradeNo, bdPayAmount, bdPayTime, bankFileDate,
      bdPayAmount, now(), 403, null, 0);
      set onlyBankHasNum = onlyBankHasNum+1;
    end loop;
    -- 更新对账文件
   update F_BANK_FILE f set f.CPNO_BANKHAS_NUM=onlyBankHasNum where f.BANK_FILE_ID=bankFileId;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for PRO_BANK_CHECK
-- ----------------------------
DROP PROCEDURE IF EXISTS `PRO_BANK_CHECK`;
DELIMITER ;;
CREATE DEFINER=`cifpay`@`%` PROCEDURE `PRO_BANK_CHECK`(fileId INT)
begin
declare bankFileDate VARCHAR(10); -- 对账文件日期
declare payContractNo VARCHAR(32); -- 资金渠道协议号
declare orderNum INT(16); -- 对账文件交易笔数
declare equalNum INT(16); -- 对平笔数
declare moneyDifferNum INT(16); -- 金额差异笔数
declare cpNoBankHasNum INT(16); -- 支付平台无银行有笔数
declare cpHasBankNoNum INT(16); -- 支付平台有银行无笔数
declare hasDoubtNum INT(16); -- 存疑笔数
declare orderNumCurr INT(8); -- 本期订单笔数
declare orderNumBefore INT(8); -- 前期订单笔数
declare expressionResult INT(1); -- 公式验证结果

  select f.BANK_FILE_DATE into bankFileDate from F_BANK_FILE f where f.BANK_FILE_ID=fileId;

  -- 统计支付平台本期笔数和前期笔数
	select count(0) into orderNumCurr from CIFPAY_LC l 
			where DATE_FORMAT(l.UPDATED_DT,'%Y-%m-%d')=bankFileDate and l.CHECK_RESULT is null and l.LC_STATE=70;

	select count(0) into orderNumBefore from CIFPAY_LC l where l.CHECK_RESULT=402 and datediff(bankFileDate, l.UPDATED_DT)<=2;
	
	-- 调用执行对账的存储过程
	call PRO_BANK_BDHAS_PAY(fileId, bankFileDate);
	call PRO_BANK_CPHAS_PAY(fileId, bankFileDate);
	call PRO_BANK_EQUALS_PAY(fileId, bankFileDate);

  -- 对账后文件被更新，此处再次查询文件
  select f.ORDER_NUM, f.EQUAL_NUM, f.MONEY_DIFFER_NUM, f.CPNO_BANKHAS_NUM, f.CPHAS_BANKNO_NUM, f.HAS_DOUBT 
		into orderNum, equalNum, moneyDifferNum, cpNoBankHasNum, cpHasBankNoNum, hasDoubtNum from F_BANK_FILE f where f.BANK_FILE_ID=fileId;

  -- 验证公式
  if orderNum = equalNum + moneyDifferNum + cpNoBankHasNum
    and orderNumCurr + orderNumBefore = equalNum + moneyDifferNum + cpHasBankNoNum + hasDoubtNum then
    set expressionResult = 0;
  else
    set expressionResult = 1;
  end if;

  -- 更新对账文件
  update F_BANK_FILE f set f.ORDER_NUM_CURR=orderNumCurr, f.ORDER_NUM_BEFORE=orderNumBefore,
    f.CHECK_TIME=now(), f.CHECK_STATUS=1, f.EXPRESSION_RESULT=expressionResult where f.BANK_FILE_ID=fileId;

end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for PRO_BANK_CPHAS_PAY
-- ----------------------------
DROP PROCEDURE IF EXISTS `PRO_BANK_CPHAS_PAY`;
DELIMITER ;;
CREATE DEFINER=`cifpay`@`%` PROCEDURE `PRO_BANK_CPHAS_PAY`(bankFileId INT, bankFileDate VARCHAR(10))
begin
	declare lcId VARCHAR(64); -- 银信证流水号
	declare lcState VARCHAR(32); -- 银信证状态
	declare lcAmt decimal(19,2); -- 交易金额
	declare updateDt datetime; -- 交易时间
	declare checkResult INT(4); -- 对账结果
	declare onlyOdHasNum INT(8) default 0; -- 支付平台有银行无笔数
	declare hasDoubtNum INT(8) default 0; -- 存疑笔数
	declare checkStatus INT(1); -- 对账状态
	declare checkTime datetime; -- 对账时间
	declare done INT DEFAULT FALSE; -- 遍历数据结束标志
	-- 赋值游标（不存在于对账文件的订单）
	declare only_cphas_cursor cursor for select l.LC_ID, l.LC_STATE, l.LC_AMT, l.UPDATED_DT from CIFPAY_LC l 
   	where ((DATE_FORMAT(l.UPDATED_DT,'%Y-%m-%d')=bankFileDate and l.LC_STATE=70 and l.CHECK_RESULT is null)
  	 	or (l.CHECK_RESULT=402 and datediff(bankFileDate, l.UPDATED_DT)<=2))
    	and l.LC_ID not in(
     	select f.ORDER_ID from F_BANK_FILE_DETAIL f
    	where f.BANK_FILE_ID=bankFileId and f.PAY_STATUS='202'
   	);
  declare CONTINUE HANDLER FOR NOT FOUND SET done = TRUE; -- 将结束标志绑定到游标

	-- 打开游标
  OPEN only_cphas_cursor;
  -- 遍历游标
	read_loop: LOOP
  fetch only_cphas_cursor into lcId, lcState, lcAmt, updateDt;
		-- 声明结束的时候
		IF done THEN
			LEAVE read_loop;
		END IF;

		if datediff(bankFileDate, updateDt) <=1 then
			set checkResult = 402;
			set hasDoubtNum = hasDoubtNum+1;
			-- 存疑时对账状态和对账时间为空
			set checkStatus = null;
			set checkTime = null;
		else
			set checkResult = 404;
			set onlyOdHasNum = onlyOdHasNum+1;
			set checkStatus = 1;
			set checkTime = now();
			-- 支付平台有银行无，保存差异结果到差异表
				CP_PAY_STATUS, CP_PAY_AMOUNT, CP_PAY_TIME, DIFFERENCE_TIME, DIFFERENCE_TYPE, DIFFERENCE_AMOUNT, DEAL_STATUS) 
				values(bankFileId, lcID, updateDt, NULL, lcState, lcAmt, updateDt, NOW(), checkResult, -lcAmt, 0);
		end if;
		 -- 更新订单
		update CIFPAY_LC l set l.CHECK_STATUS=checkStatus,l.CHECK_RESULT=checkResult,l.CHECK_TIME=checkTime where l.LC_ID=lcId;
		
	end loop;
	-- 更新文件
	update F_BANK_FILE f set f.HAS_DOUBT=hasDoubtNum,f.CPHAS_BANKNO_NUM=onlyOdHasNum where f.BANK_FILE_ID=bankFileId;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for PRO_BANK_EQUALS_PAY
-- ----------------------------
DROP PROCEDURE IF EXISTS `PRO_BANK_EQUALS_PAY`;
DELIMITER ;;
CREATE DEFINER=`cifpay`@`%` PROCEDURE `PRO_BANK_EQUALS_PAY`(bankFileId INT, bankFileDate VARCHAR(10))
begin
	declare cpLcId VARCHAR(64); -- 平台银信证流水号
	declare cpLcAmt decimal(19,2); -- 平台银信证金额
	declare cpLcState VARCHAR(32); -- 平台银信证状态
	declare cpUpdateDt datetime; -- 平台银信证交易时间
	declare bdTradeNo VARCHAR(64); -- 银行交易流水号
	declare bdFileDetailId INT(16); -- 对账文件明细ID
	declare bdPayAmount decimal(18,2); -- 银行交易金额
	declare bdPayTime datetime; -- 银行交易时间
	declare checkResult INT(4); -- 对账结果
	declare equalNum INT(8) default 0; -- 对平笔数
	declare moneyDifferNum INT(8) default 0; -- 金额差错笔数
	declare done INT DEFAULT FALSE; -- 遍历数据结束标志
	#定义游标（支付平台和对账文件都有的支付平台流水号）
	declare lc_cursor cursor for select a.LC_ID,a.LC_AMT,a.LC_STATE,a.UPDATED_DT from
		(select p.LC_ID,p.LC_AMT,p.LC_STATE,p.UPDATED_DT from CIFPAY_LC p 
			 where (p.LC_STATE=70 and p.CHECK_RESULT is null and date_format(p.UPDATED_DT,'%Y-%m-%d')=bankFileDate)
				 or (p.CHECK_RESULT=402 and datediff(bankFileDate, p.UPDATED_DT)<=2)) a
			join
			(select f.ORDER_ID from F_BANK_FILE_DETAIL f
				where f.BANK_FILE_ID=bankFileId and f.PAY_STATUS='202') b
			on a.LC_ID=b.ORDER_ID;
  declare CONTINUE HANDLER FOR NOT FOUND SET done = TRUE; -- 将结束标志绑定到游标

  -- 打开游标
  OPEN lc_cursor;
  -- 遍历游标
	read_loop: LOOP
	fetch lc_cursor into cpLcId, cpLcAmt, cpLcState, cpUpdateDt;
		-- 声明结束的时候
		IF done THEN
			LEAVE read_loop;
		END IF;

		select d.BANK_FILE_DETAIL_ID, d.PAY_CHANNEL_TRADE_NO, d.PAY_AMOUNT, d.PAY_TIME into bdFileDetailId, bdTradeNo, bdPayAmount, bdPayTime 
			from F_BANK_FILE_DETAIL d where d.ORDER_ID=cpLcId and d.BANK_FILE_ID=bankFileId and d.PAY_STATUS=202;

		-- 比较金额确定对账结果
		if cpLcAmt = bdPayAmount then
			set checkResult = 401;
			set equalNum = equalNum+1;
		else
			set checkResult = 405;
			set moneyDifferNum = moneyDifferNum+1;
			-- 保存差异结果到差异表
        CP_DEAL_TYPE_ID, CP_PAY_STATUS, CP_PAY_AMOUNT, CP_PAY_TIME, BD_TRADE_NO, BD_BANK_AMOUNT, BD_PAY_TIME, BD_BANK_FILE_DATE,
        DIFFERENCE_AMOUNT, DIFFERENCE_TIME, DIFFERENCE_TYPE, CHECK_MISTAKE_NO, DEAL_STATUS) 
				values(bdFileDetailId, bankFileId, cpUpdateDt, cpLcId, null, 
        null, cpLcState, cpLcAmt, cpUpdateDt, bdTradeNo, bdPayAmount, bdPayTime, bankFileDate,
        bdPayAmount-cpLcAmt, now(), checkResult, null, 0);
		end if;	

		-- 更新文件明细
		update F_BANK_FILE_DETAIL d set d.CHECK_RESULT=checkResult where d.BANK_FILE_DETAIL_ID=bdFileDetailId;
		-- 更新订单
		update CIFPAY_LC l set l.CHECK_STATUS=1,l.CHECK_RESULT=checkResult,l.CHECK_TIME=now(),
		l.BANK_FILE_DATE=bankFileDate where l.LC_ID=cpLcId;
		
	end loop;
	-- 更新文件
	update F_BANK_FILE f set f.EQUAL_NUM=equalNum,f.MONEY_DIFFER_NUM=moneyDifferNum where f.BANK_FILE_ID=bankFileId;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for PRO_CREATE_BANK_FILE
-- ----------------------------
DROP PROCEDURE IF EXISTS `PRO_CREATE_BANK_FILE`;
DELIMITER ;;
CREATE DEFINER=`cifpay`@`%` PROCEDURE `PRO_CREATE_BANK_FILE`()
BEGIN
	DECLARE tradeChnId VARCHAR(15); -- 渠道ID
	DECLARE fileCount int; -- 文件记录数
	DECLARE bankFileDate VARCHAR(10);
	DECLARE done INT DEFAULT FALSE; -- 遍历数据结束标志
	#定义游标（新版银信证渠道ID）
	DECLARE trd_channel_cursor CURSOR FOR SELECT c.TRADE_CHN_ID FROM CIFPAY_TRADE_CHANNEL c WHERE c.TRADE_CHN_TYPE='20';
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE; -- 将结束标志绑定到游标

	SET bankFileDate = date_format(date_sub(curdate(),interval 1 day) ,'%Y-%m-%d');

	-- 打开游标
  OPEN trd_channel_cursor;
  -- 遍历游标
	read_loop: LOOP
	fetch trd_channel_cursor into tradeChnId;
		-- 声明结束的时候
		IF done THEN
			LEAVE read_loop;
		END IF;

		SELECT count(0) into fileCount from F_BANK_FILE f where f.PAY_CONTRACT_NO=tradeChnId and f.BANK_FILE_DATE=bankFileDate;
		if fileCount = 0 THEN
				values(bankFileDate, tradeChnId, 'system', '系统', now());
		END IF;
	END LOOP;
END
;;
DELIMITER ;
